	(2066, 3, 'Title', 'sub-title', 9, 2, '2020-05-01', '2020-05-18', 'voucher', '6/f/4', 0, 0, 'd8328e646c2f5171fd7be35760346af1', 'questionnaire', 0, NULL, 0, NULL, NULL, '{"inputObjs":[{"name":"","inputType":"system-page","question":"","required":"1","note1":"","options":["background-color:white;color:black;font-size:14px;max-width:640px;padding-top:60px;"]}]}', 'fixed', 0, 'form_voucher', NULL, 'none', NULL, 'Code:string|Serial:integer', 11, 11, '{"inputObjs":[{"name":"Name","inputType":"simple-text","question":"","required":"1","notes1":"","notes2":"","options":[]},{"name":"Email","inputType":"email","question":"","required":"1","notes1":"","notes2":"","options":[]},{"name":"Policy Number","inputType":"simple-text","question":"","required":"1","notes1":"","notes2":"","options":[]},{"name":"Activation Key","inputType":"simple-text","question":"","required":"1","notes1":"","notes2":"","options":[]},{"name":"Deadline","inputType":"simple-text","question":"","required":"1","notes1":"","notes2":"","options":[]}]}', NULL, 160, 0, NULL, NULL, 0, NULL, NULL, 'pending', 0, NULL, 'Free coffee voucher for QBE B2C Travel Insurance (T0533793)', NULL, '致尊貴的客戶：\r\n\r\n為感謝您使用網上平台投保 QBE 單次旅遊保險 ，我們特別送上 Pacific Coffee 細杯裝電子 \r\n咖咖啡卷乙張。憑以下連結網址可於全線香港 Pacific Coffee (銅鑼灣 Midtown 及亞洲國際博 \r\n覽館分店除外)換領細杯裝手調熱飲一杯。\r\n\r\nPacific Coffee特此通知由於客戶嘗試用假冒憑證去換領數量有上升趨勢，因此現時客戶需要4位數字密碼去啟動憑證以便到店內換領。\r\n\r\n為了方便貴客戶，我們在以下提供連結網址和密碼去啟動憑證：\r\n\r\nPacific Coffee細杯裝電子咖啡券，請於有效期2020年3月1日或之前啟動兌換憑證。\r\nhttps://hk.txp.one/v/EcGTv1vZHH2 (密碼: 3768）\r\n\r\n\r\n\r\nDear valued customer:\r\n\r\nThank you for issuing single trip travel (T0533793) via QBE online platform. Here\'s your Pacific Coffee short\r\nsize e-coffee voucher. To redeem the voucher, please click the link blow. Available for any Pacific Coffee in\r\nHong Kong (except Causeway Bay Midtown and Asia World Expo coffeehouses) to collect a short\r\nsize hot handcrafted beverage.\r\n\r\nPacific Coffee notice us due to increase of customer try to redeem counterfeit digital voucher, a set of 4 digits password require to unlock the digital voucher for in-store redemption. \r\n\r\nTo reduce your workload we would like to combine your template wording with the activation URL & password as below:\r\n\r\n\r\nPacific Coffee Short Size e-Coffee Voucher，please activate at https://hk.txp.one/v/EcGTv1vZHH2 (password: 3768) by 01 Mar 2020 for redemption. \r\n\r\n\r\nBest Regards\r\nFiona Lee\r\nExecutive, Agency Management\r\nManulife Partnership | Asia\r\n33/F, Oxford House, Taikoo Place, \r\n979 King’s Road, Quarry Bay, Hong Kong\r\n+852 2828 1968 | fiona.lee@qbe.com\r\n\r\nWebsite\r\nLinkedIn\r\nTwitter\r\n\r\n \r\n\r\n', NULL, NULL, '2020-05-25 16:48:27', '2020-06-02 13:48:05'),
